import About from './About'
import { Router, Switch } from "react-router-dom";
import Contact from './Contact';


const App = () => {
  return (
    <>

      <Switch>
        <Router path='/' component={Ab} />
      </Switch>
      {/* <About/>
      <Contact/> */}
    </>
  )
}

export default App
